import React from "react";
import settings from "../../../src/assets/Icons/settings.jpg";
export default function Swap() {
  return (
    // center div with glassmorphism
    <div
      className="container"
      style={{
        display: "flex",
        height: "40vh",
        width: "30vw",
        border: "1px solid rgba(255, 255, 255, 0.2)",
        backdropFilter: "blur(4px)",
        //rounded corners
        borderRadius: "10px",
      }}>
      <div className="row">
        <div className="col-10">
          <h3 className="text-white">
            Hello i am suresh raina and i do alot of work
          </h3>
        </div>

        <div className="col-1">
          <img
            src={settings}
            style={{
              height: "30px",
              width: "30px",
            }}
          />
        </div>
      </div>
    </div>
  );
}
